import React from 'react';
import { useState } from 'react';
// axiosInstance.js
import axios from 'axios';
import axiosinstance from './App';

const axiosInstance = axios.create({
    baseURL: 'http://localhost:3000/api', // Replace with your base API URL
    timeout: 5000, // Optional: set a timeout
    headers: {
      'Content-Type': 'application/json',
      'Authorization': 'Bearer YOUR_ACCESS_TOKEN', // Add token if needed
    },
  });
const fetchPostData = async (endpoint) => {
    try {
        const response = await axiosInstance.get(endpoint);
        console.log('Data:', response);
        return response.data;
    } catch (error) {
        console.error('Error:', error);

    }
};

export default function FullCartView() {
    const [posts, setPosts] = useState([]);
  
    useEffect(() => {
      // Fetch posts when the component mounts
      const fetchData = async () => {
        const data = await fetchPostData('/posts/latest'); // Replace with your endpoint
        setPosts(data.slice(0, 5)); // Limit to the first 5 posts
      };
      fetchData();
    }, []);
  
    return (
      <div>
        <h1>Latest Posts</h1>
        {posts.length > 0 ? (
          <ul>
            {posts.map((post) => (
              <li key={post.post_id}>
                <strong>Main Topic:</strong> {post.main_topic}, <strong>Question Asked:</strong> {post.question_asked}
              </li>
            ))}
          </ul>
        ) : (
          <p>Loading posts...</p>
        )}
      </div>
    );
  }
